import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter, Route } from 'react-router-dom';

const App = () => {
  return (
    <div>
      <div className="navigation-wrapper">
        <div className="site-name">
          <label>Kareem Sasa's Porfolio</label>
        </div>
        <div className="top-navigation">
          <nav role="navigation" id="site-nav" className="nav">
            <button type="button" role="button" id="menutoggle" className="navtoggle navicon-lines-button x" aria-hidden="true">
              <span class="navicon-lines"></span>
              "menu"
            </button>
            <BrowserRouter>
              <div>
                <Header />
                <Route path="/" />
              </div>
            </BrowserRouter>
          </nav>
        </div>
      </div>
    </div>
  );
};

ReactDOM.render(<App />, document.querySelector('#root'));
